from typing import List


def remove_duplicates(numbers: List[int]) -> List[int]:
    """ From a list of integers, remove all elements that occur more than once.
    Keep order of elements left the same as in the input.
    >>> remove_duplicates([1, 2, 3, 2, 4])
    [1, 3, 4]
    """
    # create a dictionary of values and indices
    # we will use this to map values to their indices
    value_index = {}
    for i, number in enumerate(numbers):
        if number in value_index:
            value_index[number].append(i)
        else:
            value_index[number] = [i]

    # create a list of values that are not repeated
    unique_values = []
    for value in value_index:
        if len(value_index[value]) == 1:
            unique_values.append(value)

    # create a new list containing only unique values
    result = []
    for value in unique_values:
        result.extend(value_index[value])
    return result
